import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faSearch } from '@fortawesome/free-solid-svg-icons'

class Router extends React.Component {

    render() {
        return (
            <form id="router">
                <input 
                    type="text" 
                    id="routerSourceInput" 
                    placeholder="Input Source Room Number"
                    value={this.props.sourceRoomId} 
                    onChange={this.props.handleChangeRouterSource}
                />
                <input 
                    type="text" 
                    id="routerDestinationInput" 
                    placeholder="Input Destination Room Number"
                    value={this.props.destinationRoomId} 
                    onChange={this.props.handleChangeRouterDestination}
                />
                <button
                    type="submit" 
                    id="routerSubmit" 
                    onClick={this.props.handleSubmitRouter}
                >
                    <FontAwesomeIcon icon={faSearch} />
                </button>
            </form>)
    }
}

export default Router
